import React from 'react';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';

const HomePage = () => {
  const navigate = useNavigate();

  const cuisines = [
    { id: 1, name: 'Italian', img: 'italian.jpg' },
    { id: 2, name: 'Chinese', img: 'chinese.jpg' },
    { id: 3, name: 'Mexican', img: 'mexican.jpg' }
  ];

  return (
    <Container>
      <h1>Select a Cuisine</h1>
      <CuisineList>
        {cuisines.map((cuisine) => (
          <CuisineCard key={cuisine.id} onClick={() => navigate(`/cuisine/${cuisine.id}`)}>
            <img src={cuisine.img} alt={cuisine.name} />
            <p>{cuisine.name}</p>
          </CuisineCard>
        ))}
      </CuisineList>
    </Container>
  );
};

const Container = styled.div`
  text-align: center;
`;

const CuisineList = styled.div`
  display: flex;
  justify-content: space-around;
  margin-top: 20px;
`;

const CuisineCard = styled.div`
  width: 200px;
  cursor: pointer;
  img {
    width: 100%;
    border-radius: 10px;
  }
  p {
    font-size: 1.5rem;
    margin-top: 10px;
  }
`;

export default HomePage;
